class Solution {
public:
    int rec(int ind,string &s,unordered_set<string>&st,vector<int>&dp)
    {
        if (ind==s.size()) return 0;
        if (dp[ind]!=-1) return dp[ind];
        int ans=s.size()-ind;
        for (int i=ind;i<s.size();i++)
        {
           string temp=s.substr(ind,i-ind+1);
           if (st.find(temp)!=st.end())
           {
              ans=min(ans,rec(i+1,s,st,dp));
           }
        }
        ans=min(ans,rec(ind+1,s,st,dp)); 
        return dp[ind]=ans;
    }
    int minExtraChar(string s, vector<string>& dictionary) 
    {
        unordered_set<string>st(dictionary.begin(), dictionary.end());
        int n=s.size();
        vector<int>dp(n+1,-1);
        return rec(0,s,st,dp);
    }
};
```
In the code provided, the bug was in the function rec. The 'ans' variable was being calculated as s.size()-ind which was causing the wrong answer. This was because it was calculating the number of extra characters left for the remaining part of the string s which was not considered in the loop. Therefore, the correct calculation is done as min(ans,rec(i+1,s,st,dp)) which calculates the minimum number of extra characters left for the remaining part of the string. The second parameter of rec function was also updated from i+1 to ind+1. This was because the loop was running from ind to i i.e., the length of substrings could be 1 or more, so, to check for the next character also, the index was increased by 1.
